import React, { Component } from "react";
import Main from "./components/main";

export class App extends Component {
  render() {
    return (
      <div>
        <Counter
          text={(text, clickHandler) => (
            <Main text={text} clickHandler={clickHandler}></Main>
          )}
        ></Counter>
      </div>
    );
  }
}

export default App;
